import React, { useEffect, useState } from 'react';

const Cars = () => {
    const [cars,setCars] = useState([])
    useEffect(()=>{
        fetch('./FakeData.JSON')
        .then(res=>res.json())
        .then(data=>setCars(data))
    },[])

    console.log();

    return (
        <div>
            <h2>Cars</h2>
        </div>
    );
};

export default Cars;
